import React from 'react';

const Card = (props) => {
	return (

		<div class="bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5">
		<img alt='robos' src="https://robohash.org/test?size=200x200"/>
		<div>
			
			<h2>props.nane</h2>
		<p> jane.doe@hmail.com </p>
		</div>
		

		</div>
		);
}

export default Card;
